import logo from './logo.svg';
import './App.css';


function Header(){
  return (
    <h1>Quizzitch</h1>
  )
}

function Menu(){
  return (
    <>
    <h3>Home</h3>
    <h3>My Quizzes </h3>
    <h3>Settings  </h3>
    </>
  )
}

function Button({btnName}){
  return (
    <button>
      {btnName}
    </button>
  )
}

function SearchBar (){
  return (
    <form>
      <input type="text" placeholder="Search..."/>
    </form>
  )
}

function Footer(){
  return(
    <p>&copy; shauvia</p>
  )
}

function App() {
  return (
    <>
      <Header/>
      <Menu/>
      <Button btnName={"Create New Quiz"}></Button>
      <Button btnName={"Recent Quizzes"}></Button>
      <SearchBar/>
      <Footer/>
    </>
  )
}

